ruby_parser:
  info: ! "ruby_parser (RP) is a ruby parser written in pure ruby (utilizing\nracc--which
    does by default use a C extension). RP's output is\nthe same as ParseTree's output:
    s-expressions using ruby's arrays and\nbase types.\n\nAs an example:\n\n    def
    conditional1 arg1\n      return 1 if arg1 == 0\n      return 0\n    end\n\nbecomes:\n\n
    \   s(:defn, :conditional1, s(:args, :arg1),\n      s(:if,\n        s(:call, s(:lvar,
    :arg1), :==, s(:lit, 0)),\n        s(:return, s(:lit, 1)),\n        nil),\n      s(:return,
    s(:lit, 0)))\n\nTested against 801,039 files from the latest of all rubygems (as
    of 2013-05):\n\n* 1.8 parser is at 99.9739% accuracy, 3.651 sigma\n* 1.9 parser
    is at 99.9940% accuracy, 4.013 sigma\n* 2.0 parser is at 99.9939% accuracy, 4.008
    sigma"
